    return (
        <div className="proizvidui-details"
        style={{  
        //   backgroundImage: "url(" + proizvod.slika_proizvoda + ")",
        //   backgroundPosition: 'center',
          backgroundSize: 'cover',
          backgroundRepeat: 'no-repeat',
          width:1000
        }}
        >

<h4>{proizvod.naziv}</h4>
      <p><strong>Cijena : </strong>{proizvod.cijena} KM</p>
      <p><strong>Marza: </strong>{proizvod.marza} KM</p>
      <p><strong>Broj telefona: </strong>{proizvod.broj_telefona}</p>
      <p><strong>Kontakt osoba: </strong>{proizvod.kontakt_osoba}</p>
      <p><strong>Email adresa: </strong>{proizvod.email_adresa}</p>
     
      </div>
    )
  }
